import css from './SignUpForm.module.css'


function SignUpForm() {
    return (
        <form>
            <label>email
                <input type="email" name="email" />
            </label>
            <label>password
                <input type="password" name='password' />
            </label>
            <button type="submit">Submit</button>
        </form>
    );
}

export default SignUpForm;
